package service

import (
	"strconv"
	"strings"
)

func GenXBLShowInfo() (si ShowInfo) {
	si = ShowInfo{
		CenterPoint: Point{
			Lng: 35.563611,
			Lat: 103.388611,
		},
		ZoomLevel: 15,
		LineList:  []Line{},
		MarkList:  []MarkPoint{},
	}

	var maxLng, minLng, maxLat, minLat float64

	dataArr := strings.Split(xbl, "],")
	var line Line
	for _, d := range dataArr {
		oneRecodeStr := strings.Trim(d, " [")
		oneRecodeArr := strings.Split(oneRecodeStr, ", ")
		lat, _ := strconv.ParseFloat(oneRecodeArr[1], 10)
		lng, _ := strconv.ParseFloat(oneRecodeArr[2], 10)
		line.Points = append(line.Points, MarkPoint{
			Point: Point{
				Lat: lat,
				Lng: lng,
			},
		})

		if lng > maxLng || maxLng == 0 {
			maxLng = lng
		}
		if lng < minLng || minLng == 0 {
			minLng = lng
		}
		if lat > maxLat || maxLat == 0 {
			maxLat = lat
		}
		if lat < minLat || minLat == 0 {
			minLat = lat
		}
	}

	si.CenterPoint.Lng = (maxLng + minLng) / 2
	si.CenterPoint.Lat = (maxLat + minLat) / 2
	si.LineList = []Line{line}

	return
}

